import React from "react";
import faker from "faker";
import "./App.css";

function App() {
  return (
    <div className="ui container comments">
      <div className="comment">
        <a href="/" className="avatar">
          <img src="{faker.image.avatar()}" alt="" />
        </a>
      </div>
    </div>
  );
}

export default App;
